The Empire Icon Award is an honorary Empire Award presented by the British film magazine "Empire". The Empire Icon Award was first introduced at the 11th Empire Awards ceremony in 2006 with Brian Cox receiving the award. The award was absent from the 12th, 17th and 18th Empire Awards ceremonies. Hugh Jackman is the most recent winner in this category.

Choose your answer: based on the paragraph above can we conclude that "Empire magazine gives out awards."?

